    ('35', 'Star Wars: Episode IV - A New Hope', 'Star Wars (retroactively titled Star Wars: Episode IV – A New Hope) is a 1977 American epic space-opera film written and directed by George Lucas, produced by Lucasfilm and distributed by 20th Century Fox. It stars Mark Hamill, Harrison Ford, Carrie Fisher, Peter Cushing, Alec Guinness, David Prowse, James Earl Jones, Anthony Daniels, Kenny Baker and Peter Mayhew. It is the first film in the Star Wars film series and fourth chronological chapter of the "Skywalker Saga".', '5', '17164', 'https://upload.wikimedia.org/wikipedia/en/8/87/StarWarsMoviePoster1977.jpg', 'FALSE', '6'),
    ('36', 'Star Wars: Episode V - The Empire Strikes Back', 'The Empire Strikes Back (also known as Star Wars: Episode V – The Empire Strikes Back) is a 1980 American epic space opera film directed by Irvin Kershner, with a screenplay by Leigh Brackett and Lawrence Kasdan, based on a story by George Lucas. The sequel to Star Wars (1977),[b] it is the second film in the Star Wars film series and the fifth chronological chapter of the "Skywalker Saga". Set three years after the events of Star Wars, the film recounts the battle between the malevolent Galactic Empire, led by the Emperor, and the Rebel Alliance, led by Princess Leia. Luke Skywalker trains to master the Force so he can confront the powerful Sith lord, Darth Vader. The ensemble cast includes Mark Hamill, Harrison Ford, Carrie Fisher, Billy Dee Williams, Anthony Daniels, David Prowse, Kenny Baker, Peter Mayhew, and Frank Oz.', '5', '32311', 'https://upload.wikimedia.org/wikipedia/en/3/3f/The_Empire_Strikes_Back_%281980_film%29.jpg', 'FALSE', '4'),
    ('37', 'Star Wars: Episode VI - Return of the Jedi', 'Return of the Jedi (also known as Star Wars: Episode VI – Return of the Jedi) is a 1983 American epic space opera film directed by Richard Marquand. The screenplay is by Lawrence Kasdan and George Lucas from a story by Lucas, who was also the executive producer. The sequel to Star Wars (1977)[a] and The Empire Strikes Back (1980), it is the third installment in the original Star Wars trilogy, the third film to be produced, and the sixth chronological film in the "Skywalker Saga". The film stars Mark Hamill, Harrison Ford, Carrie Fisher, Billy Dee Williams, Anthony Daniels, David Prowse, Kenny Baker, Peter Mayhew and Frank Oz.', '5', '44073', 'https://upload.wikimedia.org/wikipedia/en/b/b2/ReturnOfTheJediPoster1983.jpg', 'FALSE', '8'),
    ('38', 'Star Wars: Episode I - The Phantom Menace', 'Star Wars: Episode I - The Phantom Menace', '5', '29392', 'https://upload.wikimedia.org/wikipedia/en/4/40/Star_Wars_Phantom_Menace_poster.jpg', 'FALSE', '1'),
    ('39', 'Star Wars: Episode III - Revenge of the Sith', 'Star Wars: Episode III - Revenge of the Sith', '5', '93137', 'https://upload.wikimedia.org/wikipedia/en/9/93/Star_Wars_Episode_III_Revenge_of_the_Sith_poster.jpg', 'FALSE', '1'),
    ('40', 'Star Wars: Episode II - Attack of the Clones', 'Star Wars: Episode II - Attack of the Clones', '5', '28221', 'https://upload.wikimedia.org/wikipedia/en/3/32/Star_Wars_-_Episode_II_Attack_of_the_Clones_%28movie_poster%29.jpg', 'FALSE', '7'),
    ('41', 'Star Wars: The Force Awakens', 'Star Wars: The Force Awakens (also known as Star Wars: Episode VII – The Force Awakens) is a 2015 American epic space opera film produced, co-written, and directed by J. J. Abrams. The sequel to Return of the Jedi (1983), it is the seventh film in the "Skywalker Saga". Set thirty years after Return of the Jedi, The Force Awakens follows Rey, Finn, Poe Dameron, and Han Solo''s search for Luke Skywalker and their fight in the Resistance, led by General Leia Organa and veterans of the Rebel Alliance, against Kylo Ren and the First Order, a successor to the Galactic Empire. The ensemble cast includes Harrison Ford, Mark Hamill, Carrie Fisher, Adam Driver, Daisy Ridley, John Boyega, Oscar Isaac, Lupita Nyong''o, Andy Serkis, Domhnall Gleeson, Anthony Daniels, Peter Mayhew, and Max von Sydow.', '5', '30935', 'https://en.wikipedia.org/wiki/File:Star_Wars_The_Force_Awakens_Theatrical_Poster.jpg', 'FALSE', '1'),
    ('42', 'Star Wars: The Clone Wars', 'Star Wars: The Clone Wars', '5', '92764', 'https://upload.wikimedia.org/wikipedia/en/7/72/Star_wars_the_clone_wars.jpg', 'FALSE', '2'),
    ('43', 'Mario Party 9', 'Mario Party 9 (Japanese: マリオパーティ9, Hepburn: Mario Pāti Nain) is a party video game developed by NDcube and published by Nintendo for the Wii.[3] The ninth main installment in the Mario Party series, it was announced at E3 2011 and released in Europe, North America, and Australia in March 2012, followed by Japan a month later. It was the first game in the series not to be developed by Hudson Soft, which was acquired and dissolved by Konami on March 1, 2012 (a day before the game''s European release). Instead, development was taken over by Nintendo studio NDCube (who remains the developer of the series to this day). This was also the final Mario game to be released on the Wii.', '6', '73869', 'https://upload.wikimedia.org/wikipedia/en/f/f0/Mario_Party_9_US_cover.jpg', 'FALSE', '7'),
    ('44', 'Mario Party 8', 'Mario Party 8 is a 2007 party video game developed by Hudson Soft and published by Nintendo for the Wii. The game is the eighth main installment in the Mario Party series, and the first title in the series released for the Wii. It was also the final home console entry to be developed by Hudson Soft, as NDcube took over development duties from Mario Party 9 onwards.', '6', '55835', 'https://upload.wikimedia.org/wikipedia/en/b/b2/Mario_Party_8_NA_Box_Art.png', 'FALSE', '6'),
    ('45', 'Mario Kart Wii', 'Mario Kart Wii[a] is a kart racing game developed and published by Nintendo for the Wii. It is the sixth installment in the Mario Kart series, and was released in April 2008. Like its previous installments, Mario Kart Wii incorporates playable characters from the Mario series, who participate in races on over 30 different race tracks using specialized items to hinder opponents or gain advantages. The game features multiple single-player and multiplayer game modes including two to four person split screen. Online multiplayer was supported until the discontinuation of Nintendo Wi-Fi Connection in May 2014. Mario Kart Wii uses the Wii Remote''s motion-controls to provide intuitive and conventional steering controls. Each copy of the game was bundled with the Wii Wheel accessory to augment this feature and mimic a steering wheel.', '6', '65836', 'https://upload.wikimedia.org/wikipedia/en/d/d6/Mario_Kart_Wii.png', 'FALSE', '6'),
    ('46', 'Donkey Kong Country Returns', 'Donkey Kong Country Returns[a] is a side-scrolling platform game developed by Retro Studios and published by Nintendo for the Wii console. The game was released first in North America in November 2010, and in PAL regions and Japan the following month. The game''s story focuses on an evil group of Tiki-like creatures known as the Tiki Tak Tribe that are unleashed on Donkey Kong Island and hypnotize the island''s animals to stealing Donkey Kong and Diddy Kong''s banana hoard, prompting the two to traverse the island to reclaim it.', '6', '68297', 'https://upload.wikimedia.org/wikipedia/en/1/1f/Donkeykongcountryreturns.jpg', 'FALSE', '1'),
    ('47', 'FIFA 08', 'FIFA 08 (titled FIFA Soccer 08 in North America) is a football simulation video game developed by EA Canada and published by Electronic Arts under the EA Sports label. It was released on all popular gaming formats in September 2007 in Europe, Australia and Asia, and in October 2007 in North America. The PlayStation 3 and Xbox 360 versions of the game feature an improved game engine with superior graphics and different commentators and are dubbed "next-generation" by EA. On all other platforms—including the PC—the game utilizes an older engine. The Nintendo DS version features fewer teams, stadiums, game modes and kits due to the limitations of the machine''s storage medium.', '6', '39136', 'https://upload.wikimedia.org/wikipedia/en/5/5f/FIFA_08_Coverart.png', 'FALSE', '3'),
    ('48', 'Final Fantasy Crystal Chronicles: The Crystal Bearers', 'Final Fantasy Crystal Chronicles: The Crystal Bearers[a] is a Wii action-adventure game announced at the Electronic Entertainment Expo.[4] It was released on November 12, 2009 in Japan and on December 26 in North America.[2][1] The game was well received in Japan, with praise for the game''s well-written story and characters, but criticizing the map system. Western reviewers however were more mixed, citing that the game was less of a traditional RPG and more for action adventure.', '6', '32000', 'https://upload.wikimedia.org/wikipedia/en/0/09/Final_Fantasy_Crystal_Chronicles_-_The_Crystal_Bearers.png', 'FALSE', '10'),
    ('49', 'Final Fantasy Fables: Chocobo''s Dungeon', 'Final Fantasy Fables: Chocobo''s Dungeon (Japanese: チョコボの不思議なダンジョン 時忘れの迷宮, Hepburn: Chokobo no Fushigi na Danjon Toki Wasure no Meikyū, "Chocobo''s Mystery Dungeon: The Labyrinth of Forgotten Time") is a role-playing video game published by Square Enix for the Wii. It is an installment in the Chocobo series that focuses on Chocobo and his quest to free a town lost in time from eternal forgetfulness.[8] It is a loose sequel to Chocobo''s Dungeon 2 on the PlayStation.', '6', '95058', 'https://upload.wikimedia.org/wikipedia/en/a/a9/Final_Fantasy_Fables-_Chocobo%27s_Dungeon_Coverart.png', 'FALSE', '7'),
    ('50', 'FIFA 15', 'FIFA 15 is a football simulation video game developed by EA Canada and published by Electronic Arts under the EA Sports label. It was released on 23 September 2014 in North America, 25 September in Europe and 26 September in the United Kingdom and Ireland[1] for the PlayStation 3, PlayStation 4, PlayStation Vita, Nintendo 3DS, Wii, Xbox One, Xbox 360, Microsoft Windows, iOS, Android and Windows Phone.[2] On PC for the first time, FIFA 15 runs on EA''s Ignite engine with the same features as the PlayStation 3 and Xbox 360 editions.[3][4] This is the final game in the FIFA series to be available on the Wii and handhelds.', '6', '75197', 'https://upload.wikimedia.org/wikipedia/en/2/23/FIFA_15_Cover_Art.jpg', 'FALSE', '2'),
