    ('61', 'And Starring Pancho Villa as Himself', 'And Starring Pancho Villa as Himself is a 2003 American made-for-television western film for HBO in partnership with City Entertainment and starring Antonio Banderas as Pancho Villa, directed by Bruce Beresford, written by Larry Gelbart and produced by Joshua D. Maurer, Mark Gordon, and Larry Gelbart. The cast also includes Alan Arkin, Jim Broadbent, Michael McKean, Eion Bailey, and Alexa Davalos.', '8', '98177', 'https://upload.wikimedia.org/wikipedia/en/b/be/Panchovillamovie2003.jpg', 'FALSE', '3'),
    ('62', 'Barb Wire', 'Barb Wire is a 1996 American superhero film based on the Barb Wire comic book series by Dark Horse. It was directed by David Hogan, produced by Brad Wyman, and written by Chuck Pfarrer and Ilene Chaiken. The film stars Pamela Anderson in the titular role, alongside Temuera Morrison, Victoria Rowell, Xander Berkeley, Udo Kier, and Steve Railsback. Although Barb Wire was panned by critics, it has attracted a cult following.', '8', '91333', 'https://upload.wikimedia.org/wikipedia/en/6/61/Barbwireposter.jpg', 'FALSE', '1'),
    ('63', 'Fermat''s Room (La habitaci√≥n de Fermat)', 'Fermat''s Room (Spanish: La habitación de Fermat) is a 2007 Spanish thriller film directed by Luis Piedrahita and Rodrigo Sopeña. Three mathematicians and one inventor are invited to a house under the premise of solving a great enigma, and told to use pseudonyms based on famous historical mathematicians. At the house, they are trapped in a room. They must solve puzzles given by the host, who calls himself "Fermat", in order to escape the slowly closing walls of the room.', '8', '8677', 'https://upload.wikimedia.org/wikipedia/en/8/80/FermatsRoom.png', 'FALSE', '3'),
    ('64', 'My Girl 2', 'My Girl 2 is a 1994 American comedy-drama film starring Dan Aykroyd, Jamie Lee Curtis, Anna Chlumsky and Austin O''Brien. A sequel to My Girl (1991), its plot follows a now-teenaged Vada Sultenfuss, who travels from her home in suburban Pennsylvania to Los Angeles to find more information about her deceased mother.', '8', '45357', 'https://upload.wikimedia.org/wikipedia/en/9/95/My_girl_two.jpg', 'FALSE', '1'),
    ('65', 'Here on Earth', 'Here on Earth is a 2000 American romantic drama film directed by Mark Piznarski from a screenplay by Michael Seitzman. The film stars Chris Klein, Leelee Sobieski, and Josh Hartnett. The original music score was composed by Kelly Jones and Andrea Morricone.', '8', '20546', 'https://en.wikipedia.org/wiki/File:Hereonearth.jpg', 'FALSE', '5'),
    ('66', 'D2: The Mighty Ducks', 'D2: The Mighty Ducks (also known as The Mighty Ducks 2) is a 1994 American sports comedy-drama film directed by Sam Weisman. It is the second installment in The Mighty Ducks trilogy, and a sequel to the 1992 film The Mighty Ducks produced by Walt Disney Pictures, The Kerner Entertainment Company and Avnet–Kerner Productions. In some countries the film was titled The Mighty Ducks (the first having been titled Champions and as The Mighty Ducks Are the Champions on home release). It was succeeded by the final film of the series, D3: The Mighty Ducks, in 1996.', '8', '52111', 'https://upload.wikimedia.org/wikipedia/en/4/42/D_two_the_mighty_ducks.jpg', 'FALSE', '1'),
    ('67', 'Kill the Irishman', 'Kill the Irishman is a 2011 American biographical crime film directed by Jonathan Hensleigh,[3] and starring Ray Stevenson, Vincent D''Onofrio, Christopher Walken, and Val Kilmer. Written by Hensleigh and Jeremy Walters, it is based on the life of the Irish-American gangster Danny Greene, and was adapted from the book To Kill the Irishman: The War That Crippled the Mafia[4] by Rick Porrello.[5][6]', '8', '10699', 'https://upload.wikimedia.org/wikipedia/en/6/65/Kill_the_irishman_poster.jpg', 'FALSE', '9'),
    ('68', 'Lost in Space', 'Lost in Space is an American science fiction television series, created and produced by Irwin Allen, which originally aired between 1965 and 1968 on CBS.[3] The series was inspired by the 1812 novel The Swiss Family Robinson. The series follows the adventures of the Robinsons, a pioneering family of space colonists who struggle to survive in the depths of space. The show ran for 83 episodes over three seasons. The first season comprised 29 episodes that ran 1 hour apiece, filmed in black and white. Later, for seasons 2 and 3, the episodes would be 54 minutes long and shot in color.', '8', '27176', 'https://upload.wikimedia.org/wikipedia/en/d/da/Lost_In_Space.jpg', 'FALSE', '1'),
    ('69', 'Swamp Water', 'Swamp Water is a 1941 American crime film directed by Jean Renoir and starring Walter Brennan and Walter Huston. Based on the novel by Vereen Bell, it was produced at 20th Century Fox. The film was shot on location at Okefenokee Swamp, Waycross, Georgia, USA. It was Renoir''s first American film. The film was remade in 1952 as Lure of the Wilderness, directed by Jean Negulesco.', '8', '85586', 'https://upload.wikimedia.org/wikipedia/en/4/46/SwampWaterPoster.jpg', 'FALSE', '5'),
    ('70', 'Heartbeat Detector (Question humaine, La)', 'Heartbeat Detector (French: La Question Humaine) is a 2007 French film directed by Nicolas Klotz and starring Mathieu Amalric. The film is based on the 2000 novel by François Emmanuel.', '8', '40369', 'https://upload.wikimedia.org/wikipedia/en/f/f1/La-question-humaine.jpg', 'FALSE', '4'),
    ('71', 'Black Sunday (La maschera del demonio)', 'Black Sunday (Italian: La maschera del demonio, lit. ''The mask of the demon'') is a 1960 Italian gothic horror film directed by Mario Bava in his official directorial debut, and starring Barbara Steele, John Richardson, Andrea Checchi, Ivo Garrani, Arturo Dominici and Enrico Oliveri. Loosely based on Nikolai Gogol''s short story "Viy", the film takes place in Moldavia and tells the story of a witch who is put to death by her brother, only to return two centuries later to seek revenge upon his descendants.', '8', '26411', 'https://upload.wikimedia.org/wikipedia/en/8/8b/La_maschera_del_demonio_%28film_cover%29.jpg', 'FALSE', '7'),
    ('72', 'Baby, the Rain Must Fall', 'Baby the Rain Must Fall is a 1965 American drama film directed by Robert Mulligan and starring Lee Remick, Steve McQueen and Don Murray. Dramatist Horton Foote, who wrote the screenplay, based it on his 1954 play The Traveling Lady.[2] This is Glen Campbell''s film debut, in an uncredited role.', '8', '76290', 'https://upload.wikimedia.org/wikipedia/en/7/79/RainMustFall.jpg', 'FALSE', '8');
